


UPDATE page_text SET text='It is not our intention to replace popular transportation methods such as ships, zeppelins, and flightmasters. These are cheap, practical, and safe methods of transportation. Portals, when used properly, are just as safe and certainly faster. HOWEVER, in practice portals have a history of being a burden on any society in which it is offered to the general public. Of all the major spells developed and maintained by the Kirin Tor (including polymorph), portal technology is the closest to becoming banished from anything but emergency usage.' WHERE entry=3443;
